import React from "react";

import { Navbar,Nav } from 'react-bootstrap';
import {
    BrowserRouter as Router,
    Link
  }  from "react-router-dom";

const NavBar=()=> {
  
  return(
    <div className="App">
 <Navbar bg="primary" variant="dark">
    <Navbar.Brand href="#home">Dairy App</Navbar.Brand>
    <Nav className="mr-auto">
      <Nav.Link > <Link to="/Home">Home</Link></Nav.Link>
      <Nav.Link href="#features"><Link to="/Registeration">Registeration</Link></Nav.Link>
      <Nav.Link href="#Login"><Link to="/Login">Login</Link> </Nav.Link>
      <Nav.Link href="#Cart"><Link to="/Cart">Cart</Link></Nav.Link>
    </Nav>
    
  </Navbar>
    </div>
)
 
}
export default NavBar;
